import React from 'react';
import {useSelector} from 'react-redux';

function Cart() {
    const books=useSelector((books)=>books.addToCart);
    console.log(books);
  return (
    <>
    <table className="table">
    <thead>
      <tr>
        <th>Firstname</th>
        <th>Lastname</th>
        <th>Email</th>
      </tr>
    </thead>
    <tbody>
        {
            books.cart.map((book)=>
            
                <tr>
                    <td>{book.name}</td>
                    <td>{book.name}</td>
                    <td>{book.name}</td>
                </tr>
            )
        }
      
    </tbody>
  </table>
    </>
  )
}

export default Cart;
